import React from 'react';
import ReactDOM from 'react-dom';

class Ramadhani extends React.Component {
  componentDidMount() {
    console.log(`mount ${this.props.warna}`);
    console.log('kepanggil');
  }

  componentWillUnmount() {
    console.log('unmount di panggil');
  }

  render() {
    return <h2 style={{ color: this.props.warna }} >Ramadhani</h2>
  }
}


const Dhani = () => {
  return <h1>asdas</h1>;
}

ReactDOM.render(<Ramadhani warna="red"/>, document.getElementById('app'));







